export default {
  name: 'FlexTable',
  props: {
    titleName: {
      type: String,
      required: true
    },
    items: {
      type: Array,
      required: true,
      default: () => []
    }
  },
  methods: {
    getClass(id) {
      if (id === 1) {
        return 'orangehrm-flex-table-value --success';
      }
      if (id === 2) {
        return 'orangehrm-flex-table-value --warning';
      }
      return 'orangehrm-flex-table-value --error';
    }
  }
};
